import React from 'react';
import { createAppContainer, createSwitchNavigator } from 'react-navigation';
import { createStackNavigator } from '@react-navigation/stack';

import PrepareToLogin from './pages/PrepareToLogin';
import Home from './pages/Home';
import LinkExpo from './pages/LinkExpo';
import CallBack from './pages/CallBack';
import Login from './pages/Login';

const MainApp = createStackNavigator({
  Home: {
    screen: Home,
    navigationOptions: {
      headerTitle: 'Home'
    },
    path: 'home'
  },
  PrepareToLogin: {
    screen: PrepareToLogin,
    navigationOptions: {
      headerTitle: 'PrepareToLogin'
    },
    path: 'preparetologin'
  },
  LinkExpo: {
    screen: LinkExpo,
    navigationOptions: {
      headerTitle: 'LinkExpo'
    },
    path: 'linkexpo'
  },
  CallBack: {
    screen: CallBack,
    navigationOptions: {
      headerTitle: 'CallBack'
    },
    path: 'callback'
  },
  Login: {
    screen: Login,
    navigationOptions: {
      headerTitle: 'Login'
    },
    path: 'login'
  }
})

const AppContainer = createAppContainer(MainApp);

export default () => {
  const prefix = 'myapp://';
  return (<AppContainer uriPrefix={prefix} /> );
}
